-- MAGIC 1. サイドバーの**Workflows**ボタンをクリックします。
-- MAGIC 1. **Delta Live Tables**タブを選択します。
-- MAGIC 1. **Create Pipeline**をクリックします。
-- MAGIC 1. **Product Edition**は**Advanced**のままにします。
-- MAGIC 1. **Pipeline name**を入力します。これらの名前は一意である必要があるため、上記のセルに記載されている **`Pipeline Name`** を使用することをおすすめします。
-- MAGIC 1. **Notebook Libraries**では、ナビゲーターを使って**day1_c3__explore_dlt**という付録のノートブックを探して選択します。
-- MAGIC    * このドキュメントは標準のDatabricksノートブックですが、SQL構文はDLTテーブル宣言に特化しています。
-- MAGIC    * 次のエクササイズでは、構文について見ていきます。
-- MAGIC 1. **Target**フィールドに、上記のセルで **`database`** の隣に表示されているデータベースの名前を指定します。<br/> データベースの名前は、 **`db_hackathon4lakehouse_<username>`** というパターンに従っているはずです。
-- MAGIC    * このフィールドは任意です。指定しなかった場合、テーブルはメタストアに登録されませんが、引き続きDBFSでは使用できます。 このオプションに関して詳しく知りたい場合は、こちらの<a href="https://docs.databricks.com/data-engineering/delta-live-tables/delta-live-tables-user-guide.html#publish-tables" target="_blank">ドキュメント</a>を参考にしてください。
-- MAGIC 1. **Storage location**フィールドは指定しない場合、DLTが自動的にディレクトリを生成します。今回は指定しないまま実行します
-- MAGIC 1. **Pipeline mode**では、**Trigger**を選択します。
-- MAGIC    * このフィールドでは、パイプラインの実行方法を指定します。
-- MAGIC    * **Trigger**パイプラインは一度だけ実行され、次の手動またはスケジュールされた更新まではシャットダウンします。
-- MAGIC    * **Continuous**パイプラインは継続的に実行され、新しいデータが到着するとそのデータを取り込みます。 レイテンシとコスト要件に基づいてモードを選択してください。
-- MAGIC 1. **Enable Auto Scaling**ボックスのチェックを外し、ワーカーの数を **`1`** （1つ）に設定します。
-- MAGIC    * **Enable Auto Scaling**、**Min workers**、**Max workers**はパイプラインをクラスタ処理する際の基盤となるワーカー構成を制御します。 
-- MAGIC 1. **Create**をクリックします。

